import React from 'react';
import { TypeAnimation } from 'react-type-animation';




const Project = () => {

  return (
    <div className='about'>
      <div className='banner-text'>
        <TypeAnimation
          cursor={false}
          sequence={[
            'Some of My Projects',
            2000,

          ]}
          wrapper="h2"
          repeat={Infinity}
          style={{ fontSize: '3em', color: 'rgb(34, 32, 32)', letterSpacing: '-2px', fontFamily: 'Rubik Maze', fontWeight: 'lighter' }}
        />
        <hr />
      </div>



      <div>
        <div class="ui tiny images"><img src="/images/wireframe/image.png" class="ui image" />
          <img src="/images/wireframe/image.png" class="ui image" />
          <img src="/images/wireframe/image.png" class="ui image" />
          <img src="/images/wireframe/image.png" class="ui image" />
        </div>
        <div class="ui hidden divider">
        </div>
        <div class="ui small images">
          <img src="/images/premium.png" class="ui image" width={250}/>
          <img src="/images/tania.png" class="ui image" width={250}/>
          <img src="/images/andey.png" class="ui image" width={250}/>
          <img src="/images/expenditure.png" class="ui image" width={250}/>
        </div>
      </div>



    </div>
  )
}

export default Project;
